description:
I&amp;#039;ve decided to upload everything, released and unreleased, right here on TPB. Sorted by by year. There were some songs that I&amp;#039;d lost the sources to, so I have included them in the highest quality I could recover.

EternuS was featured in Dance Dance Revolution Universe 2 for Xbox360 and Dance Dance Revolution SuperNOVA 2 for Playstation 2. It has since been re-mastered for your listening pleasure.

This release is official and straight from the source. Enjoy!
